import React from 'react';
import './About.css';

const About = () => {
  return (
    <div className="about">
      <img src="https://www.lafrenchfab.fr/storage/sites/2/2024/01/logoepsi.png" alt="EPSI Logo" className="epsi-logo" />
      <h2>About CheckMate News</h2>
      <p>CheckMate News est un projet dédié à la vérification des faits et à la lutte contre les fausses informations. Notre objectif est de fournir des informations précises et vérifiées au public, en utilisant des technologies de pointe et une IA avancée pour analyser et catégoriser les requêtes.</p>
      <p>Ce projet est réalisé dans le cadre de notre dernière année à l'école Paris EPSI. Nous sommes passionnés par l'innovation technologique et la manière dont elle peut être utilisée pour résoudre des problèmes réels et améliorer la société.</p>
    </div>
  );
};

export default About;
